<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>

    <title>mega-kiosk-16</title>
    <style>
        * {
            padding: 0;
            margin: 0;
            box-sizing: border-box;
        }
        html, body {
            height: 100%;
        }
        body {
            font-family: 'Inter', sans-serif;
            background-color: #000000;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            align-items: center;
        }
        .top {
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            width: 100%;
            height: 145px;
            z-index: -1;
        }
        .top img {
            width: 100%;
            height: 100%;
        }
        .bottom {
            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
            width: 100%;
            height: 109px;
            z-index: 0;
        }
        .bottom img {
            width: 100%;
            height: 100%;
        }
        .wrap  {
            height: 100%;
            width: 100%;
        }
        .container {
            max-width: 325px;
            margin: 0 auto;
        }
        .logo {
            width: 66%;
            max-width: 214px;
            margin-left: auto;
        }
        .logo img {
            width: 100%;
        }
        .box {
            width: 100%;
            position: absolute;
            left: 50%;
            top: 50%;
            transform: translate(-50%, -50%);
        }
        main {
            max-width: 325px;
            margin: 0 auto;
        }
        .banner {
            height: 170px;
            width: 100%;
        }
        .banner img {
            margin: 0 auto;
            width: 100%;
            z-index: -1;

        }
        .btn-group {
            margin: 0 auto;
        }
        .btn {
            max-width: 95%;
            margin: 26px auto 26px;
            height: 80px;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        .btn img {
            width: 100%;
        }
        footer {
            width: 100%;
            margin: 20px auto 0;

            font-style: normal;
            font-weight: 400;
            font-size: 12px;
            line-height: 15px;
            text-align: center;
            color: #FFFFFF;


            position: absolute;
            bottom: 0;
            left: 0;
            right: 0;
        }
        footer a {
            color: inherit;
        }
        @media (max-height: 500px) and (orientation: portrait) {
            .btn {
                margin-top: 0;
                margin-bottom: 3vh;
            }
            .box {
                transform: translate(-50%, -52%);
            }
        }
        @media (max-height: 460px) and (orientation: portrait) {
            .btn {
                /*margin-top: 3vh;*/
                /*margin-bottom: 3vh;*/
            }
        }
        @media (max-height: 420px) and (orientation: portrait){
            .banner {
                display: none;
            }
        }
        @media  (orientation: landscape) {
        }
        @media  (max-height: 460px) and (orientation: landscape) {
            .banner {
                display: none;
            }
        }
        @media  (max-height: 320px) and (orientation: landscape) {
            footer {
                font-size: 8px;
                line-height: 10px;
            }
        }

    </style>
</head>
